import React from "react";

function SmartTitle2(props){
    return(
        <div className="smart-title-2" 
        style={{
            "--stl-bg-color": props.bgColor
        }}
        >
             <div className="smart-title-container2">
                <h3 id="h3-title">{props.h3Title}</h3>
                <h1 id="h1-title-a">{props.h1TitleA} </h1> <h1 id="h1-title-b">{props.h1TitleB}</h1>
            </div>
        </div>
    );
}

export default SmartTitle2;
